import { Col } from 'reactstrap';
import Settings from '../Components/Settings/Settings';

class SettingsPage extends React.Component{
    render(){
        return (
            <Col sm="10">
                <Inventory/>
            </Col>
          );
    }
};

export default SettingsPage;
